import styled from "styled-components";

const Contact = () => {
  const Wrapper = styled.section`
    padding: 9rem 0 5rem 0;
    text-align: center;

    .container {
      margin-top: 6rem;

      .contact-form {
        max-width: 50rem;
        margin: auto;

        .contact-inputs {
          display: flex;
          flex-direction: column;
          gap: 3rem;

          input[type="submit"] {
            cursor: pointer;
            transition: all 0.2s;

            &:hover {
              background-color: ${({ theme }) => theme.colors.white};
              border: 1px solid ${({ theme }) => theme.colors.btn};
              color: ${({ theme }) => theme.colors.btn};
              transform: scale(0.9);
            }
          }
        }
      }
    }
  `;

  return <Wrapper><iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3619.160605658743!2d67.19249291472734!3d24.892502784038864!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3eb337595022521b%3A0xca7caa1016a276f5!2sLiaquat%20Market!5e0!3m2!1sen!2s!4v1672260479785!5m2!1sen!2s "
   width="600"
   height="450"
    style={{border: 0}}
     allowfullscreen=""
     loading="lazy"
      referrerpolicy="no-referrer-when-downgrade">
        </iframe></Wrapper>
};

export default Contact;
